import React, { Fragment } from "react";

// Import styles
import s from "../../../styles/profile.module.css";

const yourFollowers = () => {
  return (
    <Fragment>
      <div className={s.FollowerContainer}></div>
    </Fragment>
  );
};

export default yourFollowers;
